import React, {Component} from "react";

class Task extends Component{
    render(){
        return(
            <div>
              {e = this.props.task}
              <p key={e.id}>{e.id} - {e.titulo} - {String(e.done)}</p>
              <input type="checkbox"/>
              <button>
                  Button
              </button>
            </div> 
        )
    }
    
}

export default Task;
